class Solution:
    def maxSumAfterOperation(self, nums: list[int]) -> int:
        curr_subarray = nums[0]
        curr_subarray_squared = nums[0] ** 2
        max_subarray = max(curr_subarray, curr_subarray_squared)
        for num in nums[1:]:
            curr_subarray_squared = max(num ** 2, curr_subarray + num ** 2)
            curr_subarray = max(num, curr_subarray + num)
            max_subarray = max(max_subarray, curr_subarray, curr_subarray_squared)
        return max_subarray

    def max_sub_array(self, nums):
        max_subarray = nums[0]
        curr_subarray = nums[0]
        for num in nums[1:]:
            curr_subarray = max(num, curr_subarray + num)
            max_subarray = max(max_subarray, curr_subarray)
        return max_subarray


